import React, { Component } from "react";
import "./index.css";
import { Header } from "antd/lib/layout/layout";
import p1 from "../../assets/img/logo.png";
import { Form, Input, Button, Checkbox } from "antd";

export default class Login extends Component {
  //ref注册表单 用于重置表单
  formRef = React.createRef();
  layout = {
    labelCol: { span: 8 },
    wrapperCol: { span: 16 },
  };

  tailLayout = {
    wrapperCol: { offset: 8, span: 16 },
  };

  //表单验证成功的回调
  onFinish = (values = "any") => {
    console.log("Success:", values);
  };

  //表单验证失败的回调
  onFinishFailed = (errorInfo = "any") => {
    console.log("Failed:", errorInfo);
  };

  //重置
  onReset = () => {
    this.formRef.current.resetFields();
  };

  usernameRules = [
    { required: true, message: "请输入账户名!" },
  ]

  render() {
    return (
      <div className="login">
        <Header className="header">
          <img src={p1} />
          <h1>React-后台管理系统</h1>
        </Header>
        <div className="login_content">
          <div className="login_">
            <h2>用户登录</h2>
            <Form {...this.layout} name="basic" initialValues={{ remember: true }} onFinish={this.onFinish} onFinishFailed={this.onFinishFailed} ref={this.formRef}>
              <Form.Item label="Username" name="username" rules={this.usernameRules}>
                <Input />
              </Form.Item>

              <Form.Item label="Password" name="password" rules={[{ required: true, message: "请输入密码!" }]}>
                <Input.Password />
              </Form.Item>

              <Form.Item {...this.tailLayout} name="remember" valuePropName="checked">
                <Checkbox>Remember me</Checkbox>
              </Form.Item>

              <Form.Item {...this.tailLayout}>
                <Button type="primary" htmlType="submit">登录</Button>
                <Button htmlType="button" onClick={this.onReset}>Reset</Button>
              </Form.Item>
            </Form>
          </div>
        </div>
      </div>
    );
  }
}
